MongoDB query to find multiple embedded documents<p>I'm trying to build my first non-trivial query with MongoDB as part of a notification system, and am trying to understand how to check that multiple embedded documents either exist matching my criteria, or don't exist at all.
(Also, I'm trying to build the query using the Spring Boot Mongo api.)</p>

<p>I have subscription documents which have criteria maps like this:</p>

<pre><code>{
    ...,
    criteria: [
        { key: "order.companyId", value: "ABC" },
        { key: "order.status", value: "NEW" }
    ]
}

{
    ...,
    criteria: [
        { key: "order.status", value: "NEW" }
    ]
}

{
    ...,
    criteria: [
        { key: "order.companyId", value: "ABC" }
    ]
}
</code></pre>

<p>When a new order comes in for company ABC, I want to generate a query which matches all three of the above subscriptions. Seems like I'll need a combination of <code>$and</code>, <code>$elemMatch</code>, and <code>$in</code>, but I can't find a good example of how to piece it all together. Can anyone give me some advice on how to get started with this?</p>

<p>In my initial attempts I've been generating criteria like this: <code>Criteria.where("criteria").elemMatch(Criteria.where("key").is(key).and("value").in(value, null))</code> but it doesn't seem to like multiple criteria for the same attribute.</p>

<hr>

<p>Making use of <a href="https://stackoverflow.com/a/49495717/446591">dsharew's advice</a>, I'm now using this method to build up a list of criteria for each key/value pair:</p>

<pre><code>private Criteria equalsOrUnspecified(String key, Object value) {
    Criteria valueMatch = Criteria.where("criteria")
            .elemMatch(Criteria.where("key").is(key).and("value").is(value));
    Criteria notSpecified = Criteria.where("criteria").not().elemMatch(Criteria.where("key").is(key));
    return new Criteria().orOperator(valueMatch, notSpecified);
}
</code></pre>

<p>and then combining them using</p>

<pre><code>        q.addCriteria(new Criteria().andOperator(criteria.toArray(new Criteria[criteria.size()])));
</code></pre>

<p>but this doesn't seem to be matching anything. Here's an example of one of the queries produced:</p>

<pre><code>{ 
    "isEnabled" : true , 
    "eventType" : "order::positionUpdate" , 
    "$and" : [ 
        { "$or" : [ { "criteria" : { "$elemMatch" : { "key" : "order.bolNumber" , "value" : "51166350"}}} , { "criteria" : { "$not" : { "$elemMatch" : { "key" : "order.bolNumber"}}}}]} ,
        { "$or" : [ { "criteria" : { "$elemMatch" : { "key" : "order.consRefNumber" , "value" : "AGVS"}}} , { "criteria" : { "$not" : { "$elemMatch" : { "key" : "order.consRefNumber"}}}}]} , 
        { "$or" : [ { "criteria" : { "$elemMatch" : { "key" : "order.operationsUser.id" , "value" : "janedoe"}}} , { "criteria" : { "$not" : { "$elemMatch" : { "key" : "order.operationsUser.id"}}}}]} , 
        { "$or" : [ { "criteria" : { "$elemMatch" : { "key" : "order.bookingUser.id" , "value" : "janedoe"}}} , { "criteria" : { "$not" : { "$elemMatch" : { "key" : "order.bookingUser.id"}}}}]} , 
        { "$or" : [ { "criteria" : { "$elemMatch" : { "key" : "order.status" , "value" : "NEW"}}} , { "criteria" : { "$not" : { "$elemMatch" : { "key" : "order.status"}}}}]} , 
        { "$or" : [ { "criteria" : { "$elemMatch" : { "key" : "order.billingCustomer.id" , "value" : "EXQUOTE"}}} , { "criteria" : { "$not" : { "$elemMatch" : { "key" : "order.billingCustomer.id"}}}}]} , 
        { "$or" : [ { "criteria" : { "$elemMatch" : { "key" : "order.bookingCustomer.id" , "value" : "EXBE63A"}}} , { "criteria" : { "$not" : { "$elemMatch" : { "key" : "order.bookingCustomer.id"}}}}]} , 
        { "$or" : [ { "criteria" : { "$elemMatch" : { "key" : "order.id" , "value" : "5849005"}}} , { "criteria" : { "$not" : { "$elemMatch" : { "key" : "order.id"}}}}]} , 
        { "$or" : [ { "criteria" : { "$elemMatch" : { "key" : "companyId" , "value" : "ABC"}}} , { "criteria" : { "$not" : { "$elemMatch" : { "key" : "companyId"}}}}]}
    ]
}
</code></pre>

