Node JS/ Mongo DB - Best practice restful API<p>I'm setting up my first RESTful API with Express &amp; Mongo DB. So far i've been trying to come up with a pattern that if I don't work on the project for a while I can easily pick up again and same goes if someone new were to join the project. </p>

<p>The basic idea is when someone hits an endpoint, if that endpoint requires amends to 1 or more Mongo DB documents then i'll go ahead and fetch that document in Mongo DB and store it in res.locals to be actioned later on in another middleware. This is shown in exports.populateUserById: </p>

<pre><code>exports.populateUserById = async (req,res,next) =&gt; {
  const user = await User.findById(req.body.userId);
  res.locals.userToAction = user;
  next();
}
</code></pre>

<p>I will then make my amend to that Mongo DB document in a separate middleware like so and reference the res.locals from the previous middleware which I can call <code>.save()</code> on no problem.:</p>

<pre><code>exports.addToTeam = async (req, res, next) =&gt; {
  res.locals.userToAction.team = req.body.teamId;
  await res.locals.userToAction.save();
  res.locals.responseData = { success: true }
  next();
}
</code></pre>

<p>Finally I go to my last middleware which is shared by all endpoints which just sends the res.JSON:</p>

<pre><code>exports.respond = (req,res) =&gt; {
  res.json(res.locals.responseData);
}
</code></pre>

<p>My full endpoint would look like this in my routes:</p>

<pre><code>  router.post('/add-user-to-team',
    authController.populateUserById,
    authController.addToTeam,
    authController.respond 
  );
</code></pre>

<p>I have found this method to be handy because I can call the populateUserById controller function on many different endpoints then in another controller function edit the document how I need to. </p>

<p>Is this a fairly typical/ acceptable pattern for a restful API with Mongo DB/ Express or am I on the wrong path?</p>

<p>Also worth mentioning. obviously there are more controller functions in between that check for valid MongoDB object id's and catch async errors but have left them out of this example.</p>

<p>Thanks!</p>

