How to use $geoNear with $lookup in mongodb aggregation<p>In my MongoDB aggregation query, I am using $lookup to join my <strong>offers</strong> collection with <strong>outlet</strong> collection. But, in my "outlets" collection, I have one field named <code>location</code> and i want the query to sort the results from closest to farthest of that location. So, how to use $geoNear with $lookup, any help would be appreciated? Below is my query:</p>

<pre><code>db.offers.aggregate([
  {
    $geoNear: {
      near: {
        type: "Points",
        coordinates: [
          22,
          77
        ]
      },
      distanceField: "distance",
      maxDistance: 5000,
      spherical: true
    }
  },
  {
    $match: {
      $and: [
        {
          'totalDiscount': {
            $gt: 40
          }
        },
        {
          'totalDiscount': {
            $lt: 60
          }
        }
      ]
    }
  },
  {
    $unwind: "$storeUuid"
  },
  {
    $lookup: {
      from: "outlets",
      localField: "storeUuid",
      foreignField: "uuid",
      as: "store"
    }
  },
  {
    $project: {
      _id: 0,
      location1: {
        $arrayElemAt: [
          "$store.location",
          0
        ]
      }
    }
  },
  {
    $addFields: {
      'location.latitude': {
        $ifNull: [
          {
            $arrayElemAt: [
