            ]
          },
          0
        ]
      },
      'location.longitude': {
        $ifNull: [
          {
            $arrayElemAt: [
              "$location1.coordinates",
              0
            ]
          },
          0
        ]
      }
    }
  },
  {
    $sort: {
      location: 1
    }
  }
])
